class App extends Component {
  render() {
    return (
      <Router>
        <div>
          {/* <HomeComponent></HomeComponent> */}
          <Switch>
          <Route exact path='/' component={HomeComponent}></Route>
          <Route exact path='/tag' render={(search) => <HomeComponent post={search}/>} />
          <Route exact path='/login' component={LoginComponent}></Route>
          {/* <Route exact path='/comment' component={DataComponent}></Route> */}
          <Route exact path='/comment' render={(p) => <DataComponent post={p} />}/>
          <Route exact path='/singlepage'
            render={(p) => <PageComponent post={p} />}
          />  
          <Route exact path='/publish' component={PublishComponent}></Route>
          </Switch>
        </div>
      </Router>
    );
  }
}


export default App;





